&gt; *From:* Ross Epstein 
&gt; *Subject: foot traffic data for COVID-19 response*
&gt; *Date:* April 17, 2020 at 6:43:37 PM EDT
&gt; *To:* <mailto:yaneer@necsi.edu|yaneer@necsi.edu>
&gt; 
&gt; Yaneer -
&gt; 
&gt; SafeGraph is making its aggregated foot traffic data available for free to help combat the spread of COVID-19. Data includes foot traffic on every commercial place in the U.S. and Canada … and also foot traffic within census block groups.
&gt; 
&gt; In this emergency we are giving away the data (at no cost). We are currently working with over 1000 academic groups, government agencies, and task forces including the City of Los Angeles, San Francisco, California Governor's office, Louisville, KY, MIT, Harvard, Brookings, McKinsey, Bain, and many more… we are all collaborating together (we have a shared Slack channel) and working around the clock.
&gt; 
&gt; Here is some of the published research we are seeing (just in the past few days) - <https://www.safegraph.com/publications> including the CDC <https://www.cdc.gov/mmwr/volumes/69/wr/mm6915e2.htm?s_cid=mm6915e2_w>
&gt; 
&gt; We are already saving a lot of lives.
&gt; 
&gt; If your team is interested in building on top of our location data, please send them this form to get started (<https://www.safegraph.com/covid-19-data-consortium>) or <https://www.safegraph.com/contact-sales?utm_medium=email&amp;utm_source=interseller&amp;utm_campaign=COVID-19-support&amp;utm_content=Consultant-Outreach&amp;is=5e9603d31703bf6363952ca8|get in touch> with our team. Would love to help with your efforts.
&gt; 
&gt; - Ross Epstein
&gt; Chief of Staff, SafeGraph
&gt; 
&gt; p.s. here is an example of how the data can be useful:
&gt; <https://www.safegraph.com/dashboard/covid19-commerce-patterns>

